"use strict";function submitForm(t){t.preventDefault();var i=$(this),r=i.attr("action");$.post(r,i.serialize(),function(t){$(".contact-form__submit").fadeTo(300,0,function(){$(".contact-form__submit").replaceWith(t),i.trigger("reset").find(":input").prop("disabled",!0).addClass("form--is-disabled")})})}$("#contact-form").submit(submitForm);